import 'react-native-gesture-handler';
import React, { Component } from 'react';
import { StyleSheet, Text, View, Button, SafeAreaView } from 'react-native';
import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import BudgetScreen from "./BudgetScreen.js";
import CurrencyScreen from "./CurrencyScreen.js";
import CategoryScreen from "./CategoryScreen.js";



function Set( { navigation } ) {
  return (

    <View style={{ flex: 1, flexdirection:'column', justifyContent: 'top' }}>

      <View style = {styles.label}>
        <Text style={styles.words}>Budget</Text>

        <View>
          <Button
            title="2000"
            onPress={() => navigation.navigate('BudgetScreen')}
          />
        </View>
      </View>

      <View style = {styles.label}>
        <Text style={styles.words}>Currency</Text>

        <View>
          <Button
          title="HKD$"
          onPress={() => navigation.navigate('CurrencyScreen')}
          />
        </View>
      </View>

      <View style = {styles.label}>
        <Text style={styles.words}>Category</Text>
        <View>
        <Button
          title="HKD$"
          onPress={() => navigation.navigate('CategoryScreen')}
          />
        </View>
      </View>
      </View>
  );
}

class SettingScreen extends React.Component {
    render(){

      const Stack = createStackNavigator();
      return (
        <Stack.Navigator initialRouteName="Set">
        <Stack.Screen name="Set" component={Set}/>
        <Stack.Screen name="BudgetScreen" component={BudgetScreen} />
        <Stack.Screen name="CurrencyScreen" component={CurrencyScreen} />
        <Stack.Screen name="CategoryScreen" component={CategoryScreen} />
        </Stack.Navigator>
      );
    }
  }


    const styles = StyleSheet.create({
      container: {
        flex: 1,
        backgroundColor: '#fff',
        alignItems: 'center',
        justifyContent: 'center',
      },

      label: {
        alignItems:'center', 
        justifyContent:'row',
        marginBottom: 5,
        backgroundColor: '#66b2ff',
        height: 80,
      },

      words: {
        fontSize: 20,
      }

    });

    export default SettingScreen;
